import "./style.css";
import NavigationBar from "./NavigationBar.jsx";
import { UserContext } from "./UserContext.jsx";
import { useState } from "react";

const App = () => {
    const[user, setUser] = useState([])

    return (
      <UserContext.Provider value={ { user, setUser } }>
      <div>
          <NavigationBar />
          <Footer />
      </div>
      </UserContext.Provider>
    )
}

export default App;
